import{_ as o,o as s,c as t,e as r}from"./chunks/framework.mYMQfzZG.js";const e="/assets/PROVODKA_12.T-9LF7nf.jpg",n="/assets/PROVODKA_24.EH3veKsx.jpg",p="/assets/PROVODKA_04.zGQ5PFAs.jpg",a="/assets/PROVODKA_05.Adt2nwI8.jpg",g="/assets/PROVODKA_11.rvEM7yet.jpg",i="/assets/Proworking_plan-3-copy-2.xkW9Y3Es.jpg",V=JSON.parse('{"title":"Проворкинг «PROVODKA»","description":"","frontmatter":{"title":"Проворкинг «PROVODKA»","date":"2015-11-23","icon":"logo.jpg","cover":"cover.jpg","address":"ул. Самокатная, 4с45","place":"Кристалл","city":"г. Москва","tel":"+7 (495) 361-34-11","email":"provodka@proworking.pro","url":"https://proworking.pro","coord":[55.75652808811811,37.67743905417032],"status":"closed"},"headers":[],"relativePath":"workshop/archive/provorking-provodka/index.md","filePath":"workshop/archive/provorking-provodka/index.md"}'),c={name:"workshop/archive/provorking-provodka/index.md"},_=r('<p><img src="'+e+'" alt=""><img src="'+n+'" alt=""></p><p>Первый проворкинг PROVODKA в Москве открылся 29 октября в строении №4 <strong>московского завода «Кристалл»</strong>. Инициатором создания проворкинга выступила команда <strong>проекта Про.Движение&gt;</strong>, под руководством Петра Виноградова, известная своими архитектурными фестивалями в городах России и СНГ, Про.Ёлкой в городе Выкса и <a href="/workshop/archive/pro-dvizhenie/">мастерскими проекта Про.Движение, которые размещены в том же здании</a>.</p><p><strong>Проворкинг</strong> <em>[professional, productive working]</em> PROVODKA – это максимально удобное пространство для талантливых и профессиональных людей желающих с нуля реализовать собственные художественные проекты.</p><p><img src="'+p+'" alt=""><img src="'+a+'" alt=""><img src="'+g+'" alt=""></p><p>Сейчас PROVODKA начинает свою работу как <strong>общественный офис на 24 рабочих места</strong>. Резиденты могут пользоваться <strong>кухней</strong>, <strong>принт-центром</strong> с возможностью печати до А0, <strong>экраном и проектором</strong> для презентации своих проектов, <strong>переговорной зоной</strong> с красивым столом ручной работы на 10-12 мест, <strong>услугами</strong> там же расположенных конструкторского бюро Bulwark, архитектурной мастерской «Проектная группа А2» и нескольких <strong>дерево- и металлообрабатывающих художественных мастерских</strong>.</p><blockquote><p><em>«Здесь пространство людей, которые делают честные вещи. Наша концепция – зарабатывать не на людях, а вместе с ними, не на пространстве, а с помощью пространства.» Петр Виноградов</em></p></blockquote><p>В планах организаторов площадки запуск образовательных программ <strong>по проектированию</strong>, художественной <strong>металлообработке</strong>, истории русского искусства и созданию <strong>кинетических скульптур</strong>.</p><p><img src="'+i+'" alt=""></p>',8),d=[_];function l(m,k,O,v,h,P){return s(),t("div",null,d)}const D=o(c,[["render",l]]);export{V as __pageData,D as default};
